import React, {useState} from "react";
import {NavLink} from "react-router-dom";
import axios from "axios";
export function CustomerDashboard(){
    const [location, setLocation] = useState()
    const handleResponse= (e) =>{
        e.preventDefault()
        axios.post("http://localhost:9087/viewshops",location)
            .then(response => {
                console.log(response)
                console.log(response.data)
            })
            .catch(err => {
                console.log(err)
            })
    }
    return(
        <>
            <form onSubmit={handleResponse}>
            <label>Choose location : </label>
            <div><input type="text" placeholder="Enter location" onChange={(e)=>{
                setLocation({...location, loc:e.target.value})
            }}/></div>
        <div><input type="submit" value="Submit" onSubmit={handleResponse}/></div>
            </form>
        </>
    )
}
